function Home() {


    return (
        <>
        <Jumbotron className="text-center">
            <h1>Welcome to Gringotts Wizarding Bank!</h1>
        </Jumbotron>
        <Row className="d-flex justify-content-between">
            <Col>
                <Mortgage />
            </Col>
